#!/usr/bin/env python3

dna1 = ''

test1 = set(dna1)
print(test1)

dna2 = ''

test2 = set(dna2)

nucl_count = {}
for i in test2:
  nucl_count[i] = dna2.count(i)
  print('Number of', i, 'in the sequence is:', nucl_count[i])

for i in nucl_count:
   nucl_content = round(nucl_count[i] / len(dna2) * 100, 2)
   print(i, 'percentage is:', nucl_content)



















